import React, { Component } from "react";

export default class DialogResult extends Component {
  constructor(props) {
    super(props);
    this.state = {
      showDialog: this.props.showDialog,
    };
  }
  hiddenDialog = () => {
    this.setState({
      showDialog: false,
    });
  };
  render() {
    let { result } = this.props;
    console.log("get data from parent", result, this.props.showDialog);
    return (
      <div
        className={
          this.state.showDialog ? "dialog__result show" : "dialog__result"
        }
      >
        <div className="dialog__result__content">
          <span className="dialog__result__title">Result</span>
          <span className="dialog__result__wpm">{result.keystrokes}</span>
          <span className="dialog__result__correct"></span>
          <span className="dialog__result__incorrect"></span>
          <span>{result.stringInput}</span>
          <div className="dialog__result__action">
            <button
              // onClick={() => this.hiddenDialog()}
              className="dialog__result__action__btn"
            >
              Ok
            </button>
          </div>
        </div>
      </div>
    );
  }
}
